// AccountDropdown.jsx
import React, { useState } from 'react';

function AccountDropdown() {
  const [isOpen, setIsOpen] = useState(false);

  return (
    <div className="account-dropdown" style={{ position: 'absolute', top: 20, right: 20 }}>
      <button onClick={() => setIsOpen(!isOpen)}>
        Account
      </button>
      {isOpen && (
        <ul>
          <li>Profile</li>
          <li>Settings</li>
          <li>Logout</li>
        </ul>
      )}
    </div>
  );
}

export default AccountDropdown;
